import {
  View,
  Text,
  Button,
  StyleSheet,
  ScrollView,
  TouchableOpacity,
  Image,
} from "react-native";
import React, { useState } from "react";
import * as WebBrowser from "expo-web-browser";

const imageWA =
  "https://firebasestorage.googleapis.com/v0/b/journeytoaustralia-b21d4.appspot.com/o/icons%2Fmaps%2FWA.png?alt=media&token=5c62ff0a-7b78-498c-8912-79f551428c28";
const imageNT =
  "https://firebasestorage.googleapis.com/v0/b/journeytoaustralia-b21d4.appspot.com/o/icons%2Fmaps%2FNT.png?alt=media&token=372604a3-1c5b-4722-b96a-0f1e8f264c4c";
const imageQLD =
  "https://firebasestorage.googleapis.com/v0/b/journeytoaustralia-b21d4.appspot.com/o/icons%2Fmaps%2FQLD.png?alt=media&token=c591370a-fdba-46e9-8dc0-9c19f6984455";
const imageSA =
  "https://firebasestorage.googleapis.com/v0/b/journeytoaustralia-b21d4.appspot.com/o/icons%2Fmaps%2FSA.png?alt=media&token=214d89fd-2bb1-47e5-b139-874fbb957002";
const imageNSW =
  "https://firebasestorage.googleapis.com/v0/b/journeytoaustralia-b21d4.appspot.com/o/icons%2Fmaps%2FNSW.png?alt=media&token=013fc89d-3e44-401d-a101-d4ec19983f3e";
const imageVIC =
  "https://firebasestorage.googleapis.com/v0/b/journeytoaustralia-b21d4.appspot.com/o/icons%2Fmaps%2FVIC.png?alt=media&token=a3a63cb9-bc69-454f-b966-9643232c6b64";
const imageTAS =
  "https://firebasestorage.googleapis.com/v0/b/journeytoaustralia-b21d4.appspot.com/o/icons%2Fmaps%2FTAS.png?alt=media&token=10c7ae1c-b08c-47e9-b3c6-86bad090f979";
const imageACT =
  "https://firebasestorage.googleapis.com/v0/b/journeytoaustralia-b21d4.appspot.com/o/icons%2Fmaps%2FACT_Circled.png?alt=media&token=886ceef0-e216-42eb-bd0c-c3935a14c2a2";

const UniversityFinder = () => {
  const [state, setState] = useState(true);
  const [checkedWA, setCheckedWA] = useState(false);
  const [checkedNT, setCheckedNT] = useState(false);
  const [checkedQLD, setCheckedQLD] = useState(false);
  const [checkedSA, setCheckedSA] = useState(false);
  const [checkedNSW, setCheckedNSW] = useState(false);
  const [checkedVIC, setCheckedVIC] = useState(false);
  const [checkedTAS, setCheckedTAS] = useState(false);
  const [checkedACT, setCheckedACT] = useState(false);

  return (
    <ScrollView style={{ marginTop: 10 }}>
      <Text style={{ fontSize: 26, marginHorizontal: 20, marginVertical: 10 }}>
        Find a University that best suits you
      </Text>

      <View style={{ marginVertical: 20 }}>
        <View style={{ justifyContent: "center", flexDirection: "row" }}>
          {/* WA */}
          {checkedWA != true ? (
            <TouchableOpacity
              onPress={() => [
                setCheckedWA(true),
                setCheckedNT(false),
                setCheckedQLD(false),
                setCheckedSA(false),
                setCheckedNSW(false),
                setCheckedVIC(false),
                setCheckedTAS(false),
                setCheckedACT(false),
                setState(false),
              ]}
            >
              <Image
                source={{
                  uri: imageWA,
                }}
                style={styles.uncheckedWA}
              />
            </TouchableOpacity>
          ) : (
            <TouchableOpacity>
              <Image
                source={{
                  uri: imageWA,
                }}
                style={[styles.uncheckedWA, styles.checkedState]}
              />
            </TouchableOpacity>
          )}

          {/* NT */}
          {checkedNT != true ? (
            <TouchableOpacity
              onPress={() => [
                setCheckedWA(false),
                setCheckedNT(true),
                setCheckedQLD(false),
                setCheckedSA(false),
                setCheckedNSW(false),
                setCheckedVIC(false),
                setCheckedTAS(false),
                setCheckedACT(false),
                setState(false),
              ]}
            >
              <Image
                source={{
                  uri: imageNT,
                }}
                style={styles.uncheckedNT}
              />
            </TouchableOpacity>
          ) : (
            <TouchableOpacity>
              <Image
                source={{
                  uri: imageNT,
                }}
                style={[styles.uncheckedNT, styles.checkedState]}
              />
            </TouchableOpacity>
          )}

          {/* QLD */}
          {checkedQLD != true ? (
            <TouchableOpacity
              onPress={() => [
                setCheckedWA(false),
                setCheckedNT(false),
                setCheckedQLD(true),
                setCheckedSA(false),
                setCheckedNSW(false),
                setCheckedVIC(false),
                setCheckedTAS(false),
                setCheckedACT(false),
                setState(false),
              ]}
            >
              <Image
                source={{
                  uri: imageQLD,
                }}
                style={styles.uncheckedQLD}
              />
            </TouchableOpacity>
          ) : (
            <TouchableOpacity>
              <Image
                source={{
                  uri: imageQLD,
                }}
                style={[styles.uncheckedQLD, styles.checkedState]}
              />
            </TouchableOpacity>
          )}
        </View>

        <View
          style={{
            justifyContent: "center",
            flexDirection: "row",
            marginLeft: 102,
            marginTop: -90,
          }}
        >
          {/* SA */}
          {checkedSA != true ? (
            <TouchableOpacity
              onPress={() => [
                setCheckedWA(false),
                setCheckedNT(false),
                setCheckedQLD(false),
                setCheckedSA(true),
                setCheckedNSW(false),
                setCheckedVIC(false),
                setCheckedTAS(false),
                setCheckedACT(false),
                setState(false),
              ]}
            >
              <Image
                source={{
                  uri: imageSA,
                }}
                style={styles.uncheckedSA}
              />
            </TouchableOpacity>
          ) : (
            <TouchableOpacity>
              <Image
                source={{
                  uri: imageSA,
                }}
                style={[styles.uncheckedSA, styles.checkedState]}
              />
            </TouchableOpacity>
          )}

          <View>
            {/* NSW */}
            {checkedNSW != true ? (
              <TouchableOpacity
                onPress={() => [
                  setCheckedWA(false),
                  setCheckedNT(false),
                  setCheckedQLD(false),
                  setCheckedSA(false),
                  setCheckedNSW(true),
                  setCheckedVIC(false),
                  setCheckedTAS(false),
                  setCheckedACT(false),
                  setState(false),
                ]}
              >
                <Image
                  source={{
                    uri: imageNSW,
                  }}
                  style={styles.uncheckedNSW}
                />
              </TouchableOpacity>
            ) : (
              <TouchableOpacity>
                <Image
                  source={{
                    uri: imageNSW,
                  }}
                  style={[styles.uncheckedNSW, styles.checkedState]}
                />
              </TouchableOpacity>
            )}

            {/* VIC */}
            {checkedVIC != true ? (
              <TouchableOpacity
                onPress={() => [
                  setCheckedWA(false),
                  setCheckedNT(false),
                  setCheckedQLD(false),
                  setCheckedSA(false),
                  setCheckedNSW(false),
                  setCheckedVIC(true),
                  setCheckedTAS(false),
                  setCheckedACT(false),
                  setState(false),
                ]}
              >
                <Image
                  source={{
                    uri: imageVIC,
                  }}
                  style={styles.uncheckedVIC}
                />
              </TouchableOpacity>
            ) : (
              <TouchableOpacity>
                <Image
                  source={{
                    uri: imageVIC,
                  }}
                  style={[styles.uncheckedVIC, styles.checkedState]}
                />
              </TouchableOpacity>
            )}
          </View>
        </View>

        <View style={{ alignItems: "flex-end" }}>
          {/* TAS */}
          {checkedTAS != true ? (
            <TouchableOpacity
              onPress={() => [
                setCheckedWA(false),
                setCheckedNT(false),
                setCheckedQLD(false),
                setCheckedSA(false),
                setCheckedNSW(false),
                setCheckedVIC(false),
                setCheckedTAS(true),
                setCheckedACT(false),
                setState(false),
              ]}
            >
              <Image
                source={{
                  uri: imageTAS,
                }}
                style={styles.uncheckedTAS}
              />
            </TouchableOpacity>
          ) : (
            <TouchableOpacity>
              <Image
                source={{
                  uri: imageTAS,
                }}
                style={[styles.uncheckedTAS, styles.checkedState]}
              />
            </TouchableOpacity>
          )}
          {/*ACT */}
          {checkedACT != true ? (
            <TouchableOpacity
              onPress={() => [
                setCheckedWA(false),
                setCheckedNT(false),
                setCheckedQLD(false),
                setCheckedSA(false),
                setCheckedNSW(false),
                setCheckedVIC(false),
                setCheckedTAS(false),
                setCheckedACT(true),
                setState(false),
              ]}
            >
              <Image
                source={{
                  uri: imageACT,
                }}
                style={styles.uncheckedACT}
              />
            </TouchableOpacity>
          ) : (
            <TouchableOpacity>
              <Image
                source={{
                  uri: imageACT,
                }}
                style={[styles.uncheckedACT, styles.checkedState]}
              />
            </TouchableOpacity>
          )}
        </View>
      </View>

      {state && (
        <View style={[styles.listContainer, { backgroundColor: "#1267E9" }]}>
          <Text style={{ color: "white", fontSize: 18, margin: 10 }}>
            Select a state from the above map to see the list of Universities
          </Text>
        </View>
      )}

      {/* ///////////////////// NSW //////////////////////////////// */}
      {checkedNSW && (
        <View style={[styles.listContainer]}>
          <Text style={styles.stateHeading}>
            New South Wales: (Sydney capital)
          </Text>

          <View style={{ alignItems: "flex-start", marginHorizontal: 15 }}>
            <TouchableOpacity
              style={styles.uniButton}
              onPress={() =>
                WebBrowser.openBrowserAsync(
                  "https://www.acu.edu.au/study-at-acu"
                )
              }
            >
              <Text style={styles.uniButtonText}>
                - Australian Catholic University
              </Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={styles.uniButton}
              onPress={() =>
                WebBrowser.openBrowserAsync(
                  "https://study.csu.edu.au/international"
                )
              }
            >
              <Text style={styles.uniButtonText}>
                - Charles Sturt University
              </Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={styles.uniButton}
              onPress={() =>
                WebBrowser.openBrowserAsync(
                  "https://www.mq.edu.au/study/information-for/international"
                )
              }
            >
              <Text style={styles.uniButtonText}>- Macquarie University</Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={styles.uniButton}
              onPress={() =>
                WebBrowser.openBrowserAsync(
                  "https://www.scu.edu.au/study-at-scu/"
                )
              }
            >
              <Text style={styles.uniButtonText}>
                - Southern Cross University
              </Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={styles.uniButton}
              onPress={() =>
                WebBrowser.openBrowserAsync(
                  "https://www.une.edu.au/study/international"
                )
              }
            >
              <Text style={styles.uniButtonText}>
                - University of New England
              </Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={styles.uniButton}
              onPress={() =>
                WebBrowser.openBrowserAsync(
                  "https://www.unsw.edu.au/study?studentType=international"
                )
              }
            >
              <Text style={styles.uniButtonText}>
                - University of New South Wales
              </Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={styles.uniButton}
              onPress={() =>
                WebBrowser.openBrowserAsync(
                  "https://www.newcastle.edu.au/study/international/study-with-us"
                )
              }
            >
              <Text style={styles.uniButtonText}>
                - University of Newcastle
              </Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={styles.uniButton}
              onPress={() =>
                WebBrowser.openBrowserAsync(
                  "https://www.sydney.edu.au/study.html"
                )
              }
            >
              <Text style={styles.uniButtonText}>- University of Sydney</Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={styles.uniButton}
              onPress={() =>
                WebBrowser.openBrowserAsync("https://www.uts.edu.au/study")
              }
            >
              <Text style={styles.uniButtonText}>
                - University of Technology Sydney
              </Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={styles.uniButton}
              onPress={() =>
                WebBrowser.openBrowserAsync(
                  "https://www.westernsydney.edu.au/international/studying/courses-for-your-success"
                )
              }
            >
              <Text style={styles.uniButtonText}>
                - Western Sydney University
              </Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={styles.uniButton}
              onPress={() =>
                WebBrowser.openBrowserAsync("https://www.uow.edu.au/study/")
              }
            >
              <Text style={styles.uniButtonText}>
                - University of Wollongong
              </Text>
            </TouchableOpacity>
          </View>
        </View>
      )}

      {/* ////////////////////// VIC //////////////////////// */}
      {checkedVIC && (
        <View style={styles.listContainer}>
          <Text style={{ fontSize: 18, margin: 10 }}>
            Victoria: (Melbourne capital)
          </Text>
          <View style={{ alignItems: "flex-start", marginHorizontal: 15 }}>
            <TouchableOpacity
              style={styles.uniButton}
              onPress={() =>
                WebBrowser.openBrowserAsync("https://www.deakin.edu.au/study")
              }
            >
              <Text style={styles.uniButtonText}>- Deakin University</Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={styles.uniButton}
              onPress={() =>
                WebBrowser.openBrowserAsync(
                  "https://federation.edu.au/international"
                )
              }
            >
              <Text style={styles.uniButtonText}>- Federation University</Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={styles.uniButton}
              onPress={() =>
                WebBrowser.openBrowserAsync(
                  "https://www.latrobe.edu.au/international"
                )
              }
            >
              <Text style={styles.uniButtonText}>- La Trobe University</Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={styles.uniButton}
              onPress={() =>
                WebBrowser.openBrowserAsync(
                  "https://www.monash.edu/study/courses"
                )
              }
            >
              <Text style={styles.uniButtonText}>- Monash University</Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={styles.uniButton}
              onPress={() =>
                WebBrowser.openBrowserAsync(
                  "https://www.rmit.edu.au/study-with-us"
                )
              }
            >
              <Text style={styles.uniButtonText}>- RMIT University</Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={styles.uniButton}
              onPress={() =>
                WebBrowser.openBrowserAsync(
                  "https://www.swinburne.edu.au/courses/"
                )
              }
            >
              <Text style={styles.uniButtonText}>
                - Swinburne University of Technology
              </Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={styles.uniButton}
              onPress={() =>
                WebBrowser.openBrowserAsync("https://divinity.edu.au/courses")
              }
            >
              <Text style={styles.uniButtonText}>- University of Divinity</Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={styles.uniButton}
              onPress={() =>
                WebBrowser.openBrowserAsync("https://study.unimelb.edu.au/")
              }
            >
              <Text style={styles.uniButtonText}>
                - University of Melbourne
              </Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={styles.uniButton}
              onPress={() =>
                WebBrowser.openBrowserAsync(
                  "https://www.vu.edu.au/study-at-vu/international-students"
                )
              }
            >
              <Text style={styles.uniButtonText}>- Victoria University</Text>
            </TouchableOpacity>
          </View>
        </View>
